import "./Navbar.css";
import {Link} from "react-router-dom";

function Navbar() {
    return (
        <nav className="NavbarItems">
            <h1 className="navbar-logo">Pong</h1>
            <ul className="nav-menu">
                    <li>
                        <a>
                            <i class="fa-solid fa-house"></i>Home
                        </a>
                    </li>
                </ul>
        </nav>
    );
}

export default Navbar;
